import React from 'react'
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import boy from './assets/Avatars/boy.png';
import man from './assets/Avatars/man.png';
import nurse from './assets/Avatars/nurse.png';
import assistant from './assets/Avatars/shop-assistant.png';
import singer from './assets/Avatars/singer.png';
import steward from './assets/Avatars/steward.png';
import "./components.css"
import { Divider } from '@mui/material';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';


export default function Storybar() {
  return (
    <div className='Storybar'>
<Stack id="bar" direction="row" spacing={2}>
      <Avatar id="sroty" alt="Remy Sharp" src={boy} />
      <ListItemText primary="Ezzkalash" secondary={<span style={{ color: 'white' }}>ezzo</span>} />

      <Avatar id="sroty" alt="Travis Howard" src={man} />
      <Avatar id="sroty" alt="Cindy Baker" src={nurse} />
      <Avatar id="sroty" alt="Cindy Baker" src={assistant} />
      <Avatar id="sroty" alt="Cindy Baker" src={singer} />
      <Avatar id="sroty" alt="Cindy Baker" src={steward} />

    </Stack>
    <Divider></Divider>
    </div>

  )
}
